/* global variables */
Tileset *ground, *spike[4], *egg[4], *egg_caught, *duck[4][4], *gravity_switch, *cube, *caterpillar[4][4], *plant[4], *bullet, *bee[4], *bee_halo, *pestle[4], *blast[2];

/* public functions */
int draw_init()
{
	ground = tileset_load(T_GROUND);

	spike[UP] = tileset_load(T_SPIKE_UP);
	spike[DOWN] = tileset_load(T_SPIKE_DOWN);
	spike[LEFT] = tileset_load(T_SPIKE_LEFT);
	spike[RIGHT] = tileset_load(T_SPIKE_RIGHT);

	egg[UP] = tileset_load(T_EGG_UP);
	egg[DOWN] = tileset_load(T_EGG_DOWN);
	egg[LEFT] = tileset_load(T_EGG_LEFT);
	egg[RIGHT] = tileset_load(T_EGG_RIGHT);
	egg_caught = tileset_load(EGG_CAUGHT);

	duck[UP][RIGHT] = tileset_load(DUCK_UP_RIGHT);
	duck[UP][LEFT] = tileset_load(DUCK_UP_LEFT);
	duck[DOWN][RIGHT] = tileset_load(DUCK_DOWN_RIGHT);
	duck[DOWN][LEFT] = tileset_load(DUCK_DOWN_LEFT);
	duck[RIGHT][UP] = tileset_load(DUCK_RIGHT_UP);
	duck[RIGHT][DOWN] = tileset_load(DUCK_RIGHT_DOWN);
	duck[LEFT][UP] = tileset_load(DUCK_LEFT_UP);
	duck[LEFT][DOWN] = tileset_load(DUCK_LEFT_DOWN);

	gravity_switch = tileset_load(T_GRAVITY_SWITCH);
	cube = tileset_load(T_CUBE);

	caterpillar[UP][RIGHT] = tileset_load(CATERPILLAR_UP_RIGHT);
	caterpillar[UP][LEFT] = tileset_load(CATERPILLAR_UP_LEFT);
	caterpillar[DOWN][RIGHT] = tileset_load(CATERPILLAR_DOWN_RIGHT);
	caterpillar[DOWN][LEFT] = tileset_load(CATERPILLAR_DOWN_LEFT);
	caterpillar[RIGHT][UP] = tileset_load(CATERPILLAR_RIGHT_UP);
	caterpillar[RIGHT][DOWN] = tileset_load(CATERPILLAR_RIGHT_DOWN);
	caterpillar[LEFT][UP] = tileset_load(CATERPILLAR_LEFT_UP);
	caterpillar[LEFT][DOWN] = tileset_load(CATERPILLAR_LEFT_DOWN);

	plant[LEFT] = tileset_load(T_PLANT_LEFT);
	plant[RIGHT] = tileset_load(T_PLANT_RIGHT);

	bullet = tileset_load(T_BULLET);

	bee[LEFT] = tileset_load(T_BEE_LEFT);
	bee[RIGHT] = tileset_load(T_BEE_RIGHT);
	bee_halo = tileset_load(BEE_HALO);

	pestle[UP] = tileset_load(T_PESTLE_UP);
	pestle[DOWN] = tileset_load(T_PESTLE_DOWN);
	pestle[LEFT] = tileset_load(T_PESTLE_LEFT);
	pestle[RIGHT] = tileset_load(T_PESTLE_RIGHT);

	blast[0] = tileset_load(BIG_BLAST);
	blast[1] = tileset_load(SMALL_BLAST);

	// if all tilesets are correctly loaded
	if(	ground &&
		spike[UP] && spike[DOWN] && spike[UP] && spike[LEFT] && spike[RIGHT] &&
		egg[UP] && egg[DOWN] && egg[LEFT] && egg[RIGHT] &&
		duck[UP][RIGHT] && duck[UP][LEFT] && duck[DOWN][RIGHT] && duck[DOWN][LEFT] && duck[RIGHT][UP] && duck[RIGHT][DOWN] && duck[LEFT][UP] && duck[LEFT][DOWN] &&
		gravity_switch && cube &&
		caterpillar[UP][RIGHT] && caterpillar[UP][LEFT] && caterpillar[DOWN][RIGHT] && caterpillar[DOWN][LEFT] && caterpillar[RIGHT][UP] && caterpillar[RIGHT][DOWN] && caterpillar[LEFT][UP] && caterpillar[LEFT][DOWN] &&
		plant[LEFT] && plant[RIGHT] &&
		bullet &&
		bee[LEFT] && bee[RIGHT] && bee_halo &&
		pestle[UP] && pestle[DOWN] && pestle[LEFT] && pestle[RIGHT] &&
		blast[0] && blast[1])
		return 0;
	// else
	draw_quit();
	return 1;
}

void draw_quit()
{
	tileset_free(ground);

	tileset_free(spike[UP]);
	tileset_free(spike[DOWN]);
	tileset_free(spike[LEFT]);
	tileset_free(spike[RIGHT]);

	tileset_free(egg[UP]);
	tileset_free(egg[DOWN]);
	tileset_free(egg[LEFT]);
	tileset_free(egg[RIGHT]);
	tileset_free(egg_caught);

	tileset_free(duck[UP][RIGHT]);
	tileset_free(duck[UP][LEFT]);
	tileset_free(duck[DOWN][RIGHT]);
	tileset_free(duck[DOWN][LEFT]);
	tileset_free(duck[RIGHT][UP]);
	tileset_free(duck[RIGHT][DOWN]);
	tileset_free(duck[LEFT][UP]);
	tileset_free(duck[LEFT][DOWN]);

	tileset_free(gravity_switch);
	tileset_free(cube);

	tileset_free(caterpillar[UP][RIGHT]);
	tileset_free(caterpillar[UP][LEFT]);
	tileset_free(caterpillar[DOWN][RIGHT]);
	tileset_free(caterpillar[DOWN][LEFT]);
	tileset_free(caterpillar[RIGHT][UP]);
	tileset_free(caterpillar[RIGHT][DOWN]);
	tileset_free(caterpillar[LEFT][UP]);
	tileset_free(caterpillar[LEFT][DOWN]);

	tileset_free(plant[LEFT]);
	tileset_free(plant[RIGHT]);

	tileset_free(bullet);

	tileset_free(bee[LEFT]);
	tileset_free(bee[RIGHT]);
	tileset_free(bee_halo);

	tileset_free(pestle[UP]);
	tileset_free(pestle[DOWN]);
	tileset_free(pestle[LEFT]);
	tileset_free(pestle[RIGHT]);

	tileset_free(blast[0]);
	tileset_free(blast[1]);
}

void draw_tileMap(const Level* level, Camera camera)
{
	int i, j, x, y, n;
	for(j=0 ; j<SCREEN_HEIGHT/TILE_HEIGHT+2 ; j++) {
		y = TILE_HEIGHT*j - (camera.y&(TILE_HEIGHT-1));
		for(i=0 ; i<SCREEN_WIDTH/TILE_WIDTH+1 ; i++) {
			x = TILE_WIDTH*i - (camera.x&(TILE_WIDTH-1));
			if((camera.x>>4)+i>=0 && (camera.y>>4)+j>=0 && (camera.x>>4)+i<level->width && (camera.y>>4)+j<level->height) {
				switch(n = level->map[((camera.y>>4)+j)*level->width + (camera.x>>4)+i]) {
					case SPIKE_UP: CopySpriteClippingMasked(spike[UP]->tile[0], spike[UP]->palette, x, y, TILE_WIDTH, TILE_HEIGHT, MASK); break;
					case SPIKE_DOWN: CopySpriteClippingMasked(spike[DOWN]->tile[0], spike[DOWN]->palette, x, y, TILE_WIDTH, TILE_HEIGHT, MASK); break;
					case SPIKE_LEFT: CopySpriteClippingMasked(spike[LEFT]->tile[0], spike[LEFT]->palette, x, y, TILE_WIDTH, TILE_HEIGHT, MASK); break;
					case SPIKE_RIGHT: CopySpriteClippingMasked(spike[RIGHT]->tile[0], spike[RIGHT]->palette, x, y, TILE_WIDTH, TILE_HEIGHT, MASK); break;
					default: if(n>=G_OUT) CopySpriteClippingMasked(ground->tile[n-G_OUT], ground->palette, x, y, TILE_WIDTH, TILE_HEIGHT, MASK);
				}
			} else CopySpriteClippingMasked(ground->tile[0], ground->palette, x, y, TILE_WIDTH, TILE_HEIGHT, MASK);
		}
	}
}

void draw_objects(const Level* level, Camera camera)
{
	int i;
	Object* object;
	for(i=0 ; level->object[i] ; i++) {
		object = level->object[i];
		switch(object->type) {
			case DUCK: CopySpriteMasked(duck[object->head][object->look]->tile[(int)object->position], duck[object->head][object->look]->palette, object->x-camera.x, object->y-camera.y, duck[object->head][object->look]->width, duck[object->head][object->look]->height, MASK); break;
			case EGG:
				if(object->position >= egg[object->head]->length) {
					CopySpriteMasked(egg[object->head]->tile[13], egg[object->head]->palette, object->x-camera.x, object->y-camera.y, egg[object->head]->width, egg[object->head]->height, MASK);
					CopySpriteMasked(egg_caught->tile[object->position-egg[object->head]->length], egg_caught->palette, object->x-camera.x, object->y-camera.y, egg_caught->width, egg_caught->height, MASK);
				} else CopySpriteMasked(egg[object->head]->tile[(int)object->position], egg[object->head]->palette, object->x-camera.x, object->y-camera.y, egg[object->head]->width, egg[object->head]->height, MASK);
				break;
			case GRAVITY_SWITCH: CopySpriteMasked(gravity_switch->tile[(int)object->position], gravity_switch->palette, object->x-camera.x, object->y-camera.y, gravity_switch->width, gravity_switch->height, MASK); break;
			case CUBE: CopySpriteMasked(cube->tile[0], cube->palette, object->x-camera.x, object->y-camera.y, cube->width, cube->height, MASK); break;
			case CATERPILLAR: CopySpriteMasked(caterpillar[object->head][object->look]->tile[(int)object->position], caterpillar[object->head][object->look]->palette, object->x-camera.x, object->y-camera.y, caterpillar[object->head][object->look]->width, caterpillar[object->head][object->look]->height, MASK); break;
			case SHOOTING_PLANT: CopySpriteMasked(plant[object->look]->tile[(int)object->position], plant[object->look]->palette, object->x-camera.x, object->y-camera.y, plant[object->look]->width, plant[object->look]->height, MASK); break;
			case BEE:
				CopySpriteMasked(bee[object->look]->tile[(int)object->position], bee[object->look]->palette, object->x-camera.x, object->y-camera.y, bee[object->look]->width, bee[object->look]->height, MASK);
				if(object->var < 6) CopySpriteMasked(bee_halo->tile[object->var/2+3], bee_halo->palette, object->x-camera.x, object->y-camera.y, bee_halo->width, bee_halo->height, MASK);
				if(object->var >= TIME_BEE-2-3*3) CopySpriteMasked(bee_halo->tile[(object->var-(TIME_BEE-2-3*3))%3], bee_halo->palette, object->x-camera.x, object->y-camera.y, bee_halo->width, bee_halo->height, MASK);
				break;
			case BULLET: CopySpriteMasked(bullet->tile[0], bullet->palette, object->x-camera.x, object->y-camera.y, bullet->width, bullet->height, MASK); break;
			case HOMING_BULLET: CopySpriteMasked(bullet->tile[1], bullet->palette, object->x-camera.x, object->y-camera.y, bullet->width, bullet->height, MASK); break;
			case PESTLE: CopySpriteMasked(pestle[object->head]->tile[(int)object->position], pestle[object->head]->palette, object->x-camera.x, object->y-camera.y, pestle[object->head]->width, pestle[object->head]->height, MASK); break;
			case DUCK_BLAST: CopySpriteClippingMaskedAlpha(blast[0]->tile[0], blast[0]->palette, object->x-(blast[0]->width-duck[UP][LEFT]->width)/2-camera.x, object->y-(blast[0]->height-duck[UP][LEFT]->height)/2-camera.y, blast[0]->width, blast[0]->height, MASK, 32-object->var); break;
			case BULLET_BLAST: CopySpriteClippingMaskedAlpha(blast[1]->tile[0], blast[1]->palette, object->x-(blast[1]->width-bullet->width)/2-camera.x, object->y-(blast[1]->height-bullet->height)/2-camera.y, blast[1]->width, blast[1]->height, MASK, 32-object->var); break;
		}
	}
}

